        return (
            <div className="addCredentials">
                <NavName pageName="DashBoard" pageDescription="See all the project listed on eJob. And Apply."  />
                <div className="addCredentials_body">
                 <AddEducation />
                 <AddExperience />
                </div>
            </div>
        )
    }
}
